Plot outline: Librarian-turned-adventurer Flynn Carsen (Wyle) endeavors to find King Solomon's mines. Noah Wyle returns as Flynn Carsen, a Librarian turned adventurer and this time his quest, to find the fabled King Solomans Mines! Shot on some of the most breathtaking locations in South Africa and Kenya, and with returning stars Olympia Dukakis, Jane Curtain and comedy legend Bob Newhart. Stunning Gabrielle Anwar (Scent of a Woman) joins the cast under the guidance of Dean Devlin (Godzilla, Independence Day, Stargate) and Director Jonathan Frakes (Star Trek- Insurrection, Clockstoppers, Thunderbirds-The Movie). The Librarian II: Return to King Solomans Mines is ready to take adventure to the next level.
